'''Dagannoth''' are monsters that live in [[Waterbirth Island Dungeon]]. There are four types: level 88 and level 90 Dagannoth, level 70 [[Dagannoth fledgling]] , and level 42 [[Dagannoth spawn]]. This article deals with the level 88 and 90 varieties, which are significantly more dangerous than their [[Dagannoth|lower levelled]] counterparts.

The level 90 Dagannoth use an accurate melee attack, which hits often and hard against players. Protect from Melee, or Barrows armour or better, and food is recommended.
The level 88 Dagannoth use a fast and very accurate ranged attack.

Level 90 Dagannoth are found in the main room (single combat area), and the multi-combat areas. Level 88 Dagannoth are in the southern path to go deeper inside the dungeon and also in multi-combat areas.

